import React from "react";
import Card from "../shared/Card";
import * as S from "./Container.style";

const CardList = () => {
  const test: number[] = [1, 2, 3, 4];

  return (
    <S.Container width='1200px' height='420px'>
      {test.map((el, idx) => (
        <Card />
      ))}
    </S.Container>
  );
};

export default CardList;
